    uint public numberOfNFT;
    // view NFT
    function checkNFT() view public returns(uint) {
        return numberOfNFT;
    }
    // increment NFT
    function incrementNFT() public {
        numberOfNFT += 1; //numberOfNFT = numberOfNFT + 1
    }
    // decrement NFT
    function decrementNFT() public {
        numberOfNFT -= 1; //numberOfNFT = numberOfNFT - 1
    }
}

